css:
.editor-colors {
  background-color: #f8f8ff;
  color: #1561ac;
}
.editor {
  background-color: #f8f8ff;
  color: #1561ac;
}
.editor .wrap-guide {
  background-color: #e1e1e1;
}
.editor .indent-guide {
  color: #e6e6e6;
}
.editor .invisible-character {
  color: #adadad;
}
.editor .gutter {
  background-color: #f8f8ff;
  color: #777777;
}
.editor .gutter .line-number.cursor-line {
  background-color: #dfdfff;
  color: #4d4d4d;
}
.editor .gutter .line-number.cursor-line-no-selection {
  background: #ffffd7;
  color: #4d4d4d;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #adadad;
}
.editor .invisible {
  color: #e1e1e1;
}
.editor .cursor {
  color: #444444;
}
.editor .selection .region {
  background-color: #dfdfff;
}
.editor .line.cursor-line {
  background-color: #ffffd7;
}
.editor .search-results .marker .region {
  background-color: #ffff00;
}
.editor .search-results .marker.current-result .region {
  background-color: #ccccff;
}
.source,
.text {
  color: #333333;
}
.comment {
  color: #999999;
  font-style: italic;
}
.comment.documentation {
  color: #dd1144;
  font-style: normal;
}
.comment.documentation .punctuation.definition.comment {
  color: #dd1144 !important;
  font-style: normal;
}
.entity.name {
  color: #008080;
}
.keyword {
  font-weight: bold;
}
.keyword.operator {
  color: #006fe0;
  font-weight: normal;
}
.keyword.control {
  color: #333333;
}
.keyword.control.import {
  color: #008080;
  font-weight: normal;
}
.storage {
  color: #333333;
  font-weight: bold;
}
.storage.type {
  font-weight: normal;
}
.storage.type.function,
.storage.type.class,
.storage.type.interface {
  color: #800080;
  font-weight: bold;
}
.storage.type.primitive {
  color: #800080;
  font-weight: bold;
}
.storage.type.annotation {
  color: #666666;
  font-weight: normal;
  font-style: italic;
}
.constant {
  color: #008080;
}
.constant.character.entity {
  color: #333333;
  font-weight: bold;
}
.constant.numeric {
  color: #009999;
}
.constant.language {
  font-weight: bold;
}
.constant.other {
  color: #333333;
}
.constant.enum {
  color: #002d7a;
}
.variable {
  color: #002d7a;
}
.variable.language {
  color: #333333;
  font-weight: bold;
}
.string {
  color: #dd1144;
}
.string.regexp {
  color: #006fe0 !important;
  font-weight: bold;
}
.string.regexp .punctuation,
.string.regexp .keyword,
.string.regexp .constant {
  color: #006fe0;
}
.string.regexp .punctuation.definition.string,
.string.regexp .keyword.definition.string,
.string.regexp .constant.definition.string {
  color: #006fe0;
}
.string .constant {
  color: #dd1144;
}
.punctuation {
  color: #333333;
}
.punctuation.inheritance {
  color: #008080;
}
.punctuation.definition.comment {
  color: #999999;
}
.punctuation.definition.string {
  color: #dd1144;
}
.punctuation.definition.variable {
  color: #002d7a;
}
.support.class,
.support.namespace,
.support.function {
  color: #008080;
}
.support.function.construct {
  color: #800080;
  font-weight: bold;
}
.support.property-name {
  font-weight: bold;
}
.entity.name.tag {
  color: #002d7a;
}
.entity.other.attribute-name {
  color: #008080;
}
.entity.inherited-class {
  color: #008080;
}
.meta.brace,
.meta.delimiter {
  color: #333333;
}
.meta.import .storage.modifier {
  color: #002d7a;
  font-weight: normal;
}
.meta.function-call,
.meta.arguments,
.meta.other {
  color: #008080;
}
.meta.method-call .method {
  color: #008080;
}
.meta.tag.structure .punctuation.tag,
.meta.tag.xml .punctuation.tag,
.meta.tag.block .punctuation.tag,
.meta.tag.inline .punctuation.tag {
  color: #002d7a;
}
.meta.tag.sgml .doctype,
.meta.tag.sgml .documentroot {
  color: #777777;
  font-style: italic;
  font-weight: normal;
}
.meta.tag.sgml .punctuation.tag {
  color: #777777;
}
.meta.tag.preprocessor .punctuation.tag,
.meta.tag.preprocessor .entity.tag {
  color: #b85c00;
}
.meta.tag.preprocessor .entity {
  color: #333333;
}
.meta .punctuation.embedded {
  color: #b85c00 !important;
}
.js.source,
.js .storage.modifier {
  color: #002d7a;
}
.js .keyword.operator.new {
  color: #333333;
  font-weight: bold;
}
.java .storage.modifier {
  color: #800080;
  font-weight: normal;
}
.java .meta.class.identifier .storage.modifier {
  font-weight: bold;
}
.java .meta.class.inherited .storage.modifier,
.java .meta.class.implemented .storage.modifier {
  color: #333333;
  font-weight: bold;
}
.java .storage.type {
  color: #008080;
}
.java .storage.type.primitive {
  color: #800080;
}
.yaml .entity.name {
  color: #333333;
  font-weight: bold;
}
.php .constant.other {
  color: #009999;
}
.php .storage.type {
  font-weight: bold;
}
.css .entity.attribute-name,
.less .entity.attribute-name {
  font-weight: bold;
}
